select "blogapp_article"."id", "blogapp_article"."title", "blogapp_article"."content", "blogapp_article"."pub_data", "blogapp_article"."author_id", "blogapp_article"."category_id", "blogapp_category"."id", "blogapp_category"."name" from "blogapp_article" inner join "blogapp_category" on ("blogapp_article"."category_id" = "blogapp_category"."id") where "blogapp_article"."id" = 1 LIMIT 21;
select ("blogapp_article_tags"."article_id") as "_prefetch_related_val_article_id", "blogapp_tag"."id", "blogapp_tag"."name" from "blogapp_tag" inner join "blogapp_article_tags" on ("blogapp_tag"."id" = "blogapp_article_tags"."tag_id") where "blogapp_article_tags"."article_id" in (1);
select "auth_user"."id", "auth_user"."password", "auth_user"."last_login", "auth_user"."is_superuser", "auth_user"."username", "auth_user"."first_name", "auth_user"."last_name", "auth_user"."email", "auth_user"."is_staff", "auth_user"."is_active", "auth_user"."date_joined" from "auth_user" where "auth_user"."id" = 1 LIMIT 21;

